// datatypes_run();
async function datatypes_run() {
    datatypes_loop(datatypes);
    async function datatypes_loop(docs) {
        for (const doc of docs) {
            let text
            try {
                const response = await fetch(`https://www.hl7.org/fhir/${doc.href}`);
                text = await response.text();
                const { window } = new JSDOM(text);
                const { document } = window;
                doc.textContent = document.querySelector(`#tabs-${doc.label}-json #json-inner .spec`)?.textContent;
                // console.log(doc.textContent)
                fs.writeFileSync("./debug", JSON.stringify(datatypes, null, 4));
            } catch (error) {
                console.log(error)
            }
            doc.data = undefined;
            doc.schema = undefined;
            if (doc.children) {
                datatypes_loop(doc.children);
            }
        }
    }
    fs.writeFileSync("./debug", JSON.stringify(datatypes, null, 4));
}

