// datatypes_schema_run()
function datatypes_schema_run() {
    const docs2 = {};
    datatypes_loop(datatypes);
    function datatypes_loop(docs) {
        for (const doc of docs) {
            // console.log(doc.label)

            if (doc.textContent) {
                let string = parse(doc.textContent);
                try {
                    eval("var json = " + string);
                    console.log(json);
                    doc.schema = json;
                    docs2[doc.label] = json;
                } catch (error) {
                    console.log(string);
                    console.log(error);
                    break;
                }
            }

            if (doc.children) {
                datatypes_loop(doc.children);
            }
        }
    }
    fs.writeFileSync("./debug", JSON.stringify(datatypes, null, 4));
}

