                        "textContent": "{\n  \"resourceType\" : \"SubscriptionStatus\",\n  // from Resource: id, meta, implicitRules, and language\n  // from DomainResource: text, contained, extension, and modifierExtension\n  \"status\" : \"<code>\", // I requested | active | error | off | entered-in-error\n  \"type\" : \"<code>\", // I R!  handshake | heartbeat | event-notification | query-status | query-event\n  \"eventsSinceSubscriptionStart\" : \"<integer64>\", // Events since the Subscription was created\n  \"notificationEvent\" : [{ // I Detailed information about any events relevant to this notification\n    \"eventNumber\" : \"<integer64>\", // R!  Sequencing index of this event\n    \"timestamp\" : \"<instant>\", // The instant this event occurred\n    \"focus\" : { Reference(Any) }, // Reference to the primary resource or information of this event\n    \"additionalContext\" : [{ Reference(Any) }] // References related to the focus resource and/or context of this event\n  }],\n  \"subscription\" : { Reference(Subscription) }, // R!  Reference to the Subscription responsible for this notification\n  \"topic\" : \"<canonical(SubscriptionTopic)>\", // Reference to the SubscriptionTopic this notification relates to\n  \"error\" : [{ CodeableConcept }] // List of errors on the subscription\n}\n",
